`,l.jsx(t.p,{children:"Spoilers below!"}),`
`,l.jsx(t.h2,{children:"Plot summary"}),`
`,l.jsxs(t.p,{children:["You, Gaia, wake up as a newly formed nature spirit on primordial Earth. Granted the role of continental-terraformer-in-chief by your boss Pan, you are tasked with taking care of the big island you find yourself on. Although things proceed smoothly for a few million years, you soon meet Laura and Sia, fellow terraformers and eccentric cat",l.jsx("sup",{children:"*"})," inventors whose experimental inventions accidentally break off pieces of the main island, creating new territories to explore."]}),`
`,l.jsx(t.p,{children:"On these new islands, you help resolve conflicts and solve a variety of problems, ranging from musical “performances” disturbing local wildlife to critical debates about whether an Isle is an Aisle. Eventually, you work alongside Pan, Laura, and Sia to maintain the ecological balance of this early Earth, concluding with a final metapuzzle through which you design a collaborative new landmass called “Ausralia”. Impressed by your work, Pan gives you the power of flight and you continue your role as caretaker of the islands, watching life flourish across the planet’s diverse ecosystems."}),`
`,l.jsxs(t.p,{children:[l.jsx("sup",{children:"*"}),"No, cats have not evolved yet. Don’t worry about it."]}),`
`,l.jsx(i,{nameWithExt:"wrapup/certificate.png",caption:"The victory certificate sent to the winning team."}),`
`,l.jsx(t.h2,{children:"Writing the hunt"}),`
`,l.jsx(t.h3,{children:"Goals"}),`
`,l.jsxs(t.p,{children:["As we began planning for GPH 2025, we were conscious that there was some desire among both writers and solvers for larger, meatier puzzles. Historically, GPH has been described as occupying a difficulty tier below ",l.jsx(t.a,{href:"https://puzzles.mit.edu",children:"MIT Mystery Hunt"})," that few other online hunts have attempted (though we’d be remiss not to mention ",l.jsx(t.a,{href:"https://teammatehunt.com",children:"Teammate Hunt"}),"). At the same time, we knew many solvers appreciated the more experimental and more bite-sized designs of GPH 2023 and 2024, and they may have shaped expectations for newer teams on what GPH 2025 would look like. We wanted to take measures to keep the hunt accessible for teams of all kinds, though at the beginning of the process we weren’t yet sure what these would look like."]}),`
`,l.jsx(t.p,{children:"The theme proposals we ended up with varied a lot in how much they relied on a unique global mechanic. In the end, we settled on having such a mechanic – every puzzle would be split into a variable number of pieces – with the provisos that it require only limited implementation work and not otherwise constrain the form or difficulty of the puzzles. This would let us take advantage of our existing website interactivity features and our experience writing more “standard” hunt puzzles, while giving our members breathing room to help with the hunt how they’d like, e.g. making art or getting up to speed on web. In the end, we had mixed results on this goal; see “Writing timeline” below for details."}),`
`,l.jsx(t.h3,{children:"Theme and story"}),`
`,l.jsxs(t.p,{children:["The proposal that won our voting this year was titled “Archipelago Hunt”. Each round is an island, with puzzles divided into chunks, and answers unlock more puzzle chunks; the incremental unlocking means solvers are expected to solve puzzles with incomplete information. Cited inspirations were The DIY Room from the ",l.jsx(t.a,{href:"https://puzzlehunt.club.cc.cmu.edu/hunt/25/view/",children:"CMU Department Store Hunt"}),", the jigsaw-puzzle-themed ",l.jsx(t.a,{href:"https://jacoblance.wordpress.com/2022/03/14/p-i-hunt-8/",children:"P.I.HUNT 8"}),", Group 4 from ",l.jsx(t.a,{href:"https://www.mezzacotta.net/puzzle/cisra/2013/puzzles.html",children:"CiSRA 2013"}),", and from a non-puzzle context, the ",l.jsx(t.a,{href:"https://archipelago.gg/",children:"Archipelago"})," multi-game randomizer. (We didn’t let ourselves play ",l.jsx(t.a,{href:"https://store.steampowered.com/app/2702170/Strange_Jigsaws/",children:"Strange Jigsaws"})," until after the hunt!)"]}),`
`,l.jsx(t.p,{children:"An early endgame idea was about continental drift, where the islands themselves would fit together, tying up the jigsaw theme. While several possible stories were proposed, such as cooking in a culinary academy or building a human body, the island theming from the original proposal won out, especially after compelling names were proposed for the characters (Pan-Gaia and Laura-Sia)."}),`
`,l.jsx(t.p,{children:"Pan was designed to be a friendly advisor-type character, who could also relay basic information about the puzzle hunt to solvers (Gaia). Meanwhile, Laura and Sia were the chaotic semi-villains, who had it in their hearts to terraform, but were so disruptive that they often ended up causing more harm than good."}),`
`,l.jsx(t.p,{children:"As we’ll mention below in the (puzzle-)writing timeline, we wanted to leave the number of and the content of rounds very flexible for writers, so we opted to have the story be episodic and low-stakes. At the same time, we wanted to continue putting together engaging storylines with interesting characters, and we tried out a “first-person” style this year where your team is characterized as a specific participant in the story, in an effort to help solvers feel a little more involved."}),`
`,l.jsx(i,{nameWithExt:"wrapup/pan.png",caption:"Original “concept art” for Pan."}),`
`,l.jsx(t.h3,{children:"Writing timeline"}),`
`,l.jsx(t.p,{children:"After settling on a theme and overall mechanic, we had to decide how strongly we wanted it to constrain individual puzzles. We would already be requiring authors to split their puzzles into pieces, and we wanted to preserve flexibility and author choice beyond that, so we decided to design several metas that wouldn’t impose additional constraints on their feeders. This resulted in an internal distinction between “flexible rounds” (which ended up being Pan’s Laboratory, Abandoned Site, and The Atoll) and “constrained rounds” (Aisle of Crosswords, Desert Island, and, to a lesser extent, The Crater)."}),`
`,l.jsx(t.p,{children:"We originally wanted a larger number of tight, constrained “mini-”rounds that played off the piece mechanic in different ways, in order to show off the theme to the fullest extent. That ended up not happening because of how behind we were on puzzle writing, but it was probably for the best given that the hunt ended up pretty long and difficult anyway. Some ideas that didn’t make the cut include:"}),`
`,l.jsxs(t.ul,{children:[`
`,l.jsxs(t.li,{children:["A round where each puzzle is missing a piece (similar to MIT Mystery Hunt 2020’s ",l.jsx(t.a,{href:"https://puzzles.mit.edu/2020/land/safari/",children:"Safari Adventure"}),")"]}),`
`,l.jsx(t.li,{children:"A round where puzzles are split into red/green/blue pieces"}),`
`,l.jsxs(t.li,{children:["A round where all puzzles are black-box/interactive (perhaps similar to ",l.jsx(t.a,{href:"https://silphpuzzlehunt.com/puzzles",children:"Silph Hunt"}),"’s Frozen Tundra)"]}),`
`,l.jsx(t.li,{children:"A round involving matching rulesets and variations to logic puzzles"}),`
`,l.jsx(t.li,{children:"A round where pieces can be matched together in multiple valid ways to make different puzzles"}),`
`,l.jsx(t.li,{children:"A round with 50+ “micropuzzles” like those from last year’s GPH"}),`
`]}),`
`,l.jsx(t.p,{children:"Metapuzzle writing proceeded at a reasonable pace:"}),`
`,l.jsxs(t.ul,{children:[`
`,l.jsx(t.li,{children:"3/20–3/27: We spent a week brainstorming metameta/endgame ideas, in case someone came up with an idea that would significantly constrain the metas. This did not happen and we punted endgame writing to later."}),`
`,l.jsx(t.li,{children:"3/27: We started brainstorming meta ideas in earnest. We had several group worksessions, and early ideas for Abandoned Site and The Atoll were discussed here."}),`
`,l.jsx(t.li,{children:"Mid-late April: Pan’s Laboratory, Abandoned Site, and The Atoll were being written, testsolved, and revised."}),`
`,l.jsx(t.li,{children:"4/26: Pan’s Laboratory answers released. This round had a relatively smooth writing process."}),`
`,l.jsx(t.li,{children:"5/3: Abandoned Site answers released. This was also relatively smooth, though there was a one-week delay after the first test, where we knew we wanted to change the answer but no one could come up with a better pun that fit the extraction method."}),`
`,l.jsx(t.li,{children:"5/11: The Atoll answers released. This meta had many excruciating revisions over 4 testsolves."}),`
`,l.jsx(t.li,{children:"Early-mid May: The Crater and Aisle of Crosswords were written. Answers released on 5/17."}),`
`,l.jsx(t.li,{children:"Desert Island was its own thing: one person was writing the whole round so there was no pressure to release answers as soon as possible. The first draft of the round was written in late July and it was finalized in early August."}),`
`]}),`
`,l.jsx(t.p,{children:"In contrast, though individual puzzle writing also started early and never completely stalled, it ended up falling far behind. In early July, a week before the first big internal testsolve, we only had 21 answers assigned and 12 puzzles successfully testsolved out of the 35 non-meta, non-Desert Island puzzles. Note that our original goal was for all the answers to be assigned by then! At this point, we seriously considered cutting the Atoll round, as only 1 of its puzzles had been successfully testsolved."}),`
`,l.jsxs(t.p,{children:["One major reason for the slow pace was that without existing examples, it was pretty hard to visualize what a puzzle that took good advantage of the theme would even look like. (We had also seen this happen when writing card puzzles for the 2023 hunt.) In addition, we hadn’t really written “standard-difficulty hunt puzzles” as a team since 2022, and were even a little rusty on ",l.jsx(t.a,{href:"https://github.com/galacticpuzzlehunt/puzzlord",children:"Puzzlord"})," workflows. After a writing retreat in late June however, and with deadlines approaching and editor sanity eroding, we were able to make a push to get most of the hunt assembled in time for the big external testsolve (see below for more)."]}),`
`,l.jsx(i,{nameWithExt:"wrapup/puzzlord.png",caption:"Note the stark change in slope before and after mid-July."}),`
`,l.jsx(t.h3,{children:"Endgame"}),`
`,l.jsxs(t.p,{children:["The capstone puzzle, ",l.jsx(t.a,{href:"https://2025.galacticpuzzlehunt.com/round/your_island",children:"Your Very Own Island"}),", was written a week before the hunt! For a long while we weren’t sure there would be a capstone puzzle at all, given all the other tasks to be done. We had kicked around the idea of using the web interface to make a big jigsaw, perhaps using pieces from all the individual puzzles in the hunt. As things came together for the external testsolve, Colin and Violet found some spare time and made it happen. See the Authors’ Notes for their commentary."]}),`
`,l.jsx(t.p,{children:"We also added the post-hunt round (Kero’s Workshop) at this time, at first to continue a running joke that likely had already overstayed its welcome, then in the hopes that teams would have fun playing with The Farmer’s Dilemma in a collaborative interface. Violet took the chance to flesh things out into a whole round as well. We realized during the hunt that for teams keeping an eye on the leaderboard, adding five puzzles to the solve count likely misled them into thinking they were further away from finishing than they actually were, oops. Hopefully no one was too discouraged by this."}),`
`,l.jsx(t.p,{children:"Through the years we’ve had a variety of ideas for optional content available to teams who want more beyond just finishing the hunt normally. Last year, the solver-submitted “Free Puzzles” definitely ended up being a bigger piece of the hunt experience than we had anticipated, and kept many teams engaged throughout the week. We think this is interesting and largely unexplored territory to think about if you’re running a hunt (...and also somehow have enough extra time to write more puzzles)."}),`
`,l.jsx(i,{nameWithExt:"wrapup/endgame.png",caption:"Though we didn’t know it at the time, the capstone puzzle had actually been brewing for months…"}),`
`,l.jsx(t.h3,{children:"Structure"}),`
`,l.jsx(t.p,{children:"Unsurprisingly, deciding on the unlock structure was a fairly involved process this year. The unlock structure for each round was decided after most of the puzzles in the round were written:"}),`
`,l.jsxs(t.ul,{children:[`
`,l.jsxs(t.li,{children:[`
`,l.jsx(t.p,{children:"Pan’s Laboratory is an exception, where the meta author decided the order. The recipes were also intentionally chosen so that some of them were fully unlocked from the beginning. For round theming, we wanted to unlock each new “region” at once, but we split some of the regions into two parts to have a more granular unlock."}),`
`]}),`
`,l.jsxs(t.li,{children:[`
`,l.jsx(t.p,{children:"Abandoned Site was the hardest to work around given the constraints. Which puzzles were on which pieces was entirely determined by the meta and had no flexibility. We picked 11/25 pieces to be unlocked at first, then 4 after first solve, then 2 after each additional solve."}),`
`]}),`
`,l.jsxs(t.li,{children:[`
`,l.jsx(t.p,{children:"(A)isle of Crosswords was all at once at the beginning, since matching pieces to puzzles is the most significant aspect of this round (this originally included the grid for the meta (!), but this was later changed to unlock upon meta unlock, and then to directly embedded within the puzzle)."}),`
`]}),`
`,l.jsxs(t.li,{children:[`
`,l.jsx(t.p,{children:"For The Crater, the pieces for each puzzle unlocked when the puzzle is unlocked (ensuring that there are 2 open puzzles at all times). This was justified by the fact that the meta puzzle involves re-grouping these pieces."}),`
`]}),`
`,l.jsxs(t.li,{children:[`
`,l.jsx(t.p,{children:"The Atoll had all “sea” pieces unlocked at first plus all pieces on three of the islands. The later unlocks are also grouped by islands, ensuring that 2~4 pieces are unlocked at a time. This was also for round theming, similar to Pan’s Laboratory."}),`
`]}),`
`,l.jsxs(t.li,{children:[`
`,l.jsx(t.p,{children:"The Desert Island was all at once! :p"}),`
`]}),`
`]}),`
`,l.jsx(t.p,{children:"While deciding on puzzle order, a small group of editors attempted to judge how solvable each puzzle was with varying numbers of pieces unlocked (a task made harder by the fact that some puzzles hadn’t been written yet). After a lot of iteration and bikeshedding, these ratings evolved into the “fruit scale” you saw for approachability ratings. This led to some heuristics for unlock ordering:"}),`
`,l.jsx(s,{children:l.jsxs(t.ul,{children:[`
`,l.jsx(t.li,{children:"Counting 🍌 as 0.5 and 🟢/💙 as 1, a team should have access to at least 2.5 open puzzles in each “big” round at a time. (The only exception is the beginning of Pan’s Laboratory, which we hope to have compensated by having two relatively easy puzzles.)"}),`
`,l.jsx(t.li,{children:"While working on 🍌 puzzles is encouraged by the previous heuristic, a team should be able to progress through the hunt while only working on only 🟢 or 💙 puzzles (though see below)."}),`
`,l.jsx(t.li,{children:"When possible, some puzzle contents were re-ordered so that it becomes more solvable with fewer pieces unlocked."}),`
`]})}),`
`,l.jsx(s,{children:l.jsx(t.p,{children:"Although our goal as writers was for teams to be making progress and solving puzzles without having 100% of the pieces (see above: this was part of the original theme concept), it’s also a natural reaction as a solver to not want to spend effort on a puzzle that might not be solvable yet or might get easier later. We came close to making it possible for teams to progress while only working on 💙 puzzles, but the constraints in Abandoned Site meant that we had to rely on the intentionally-overclued Grid Logic as the only available 🟢 puzzle."})}),`
`,l.jsx(t.h3,{children:"Testsolving and factchecking"}),`
`,l.jsxs(t.p,{children:["After managing micropuzzle writing and testing through a Discord forum in 2024, we returned to using Puzzlord this year in conjunction with a testsolving lead (Mark) who regularly pinged people and scheduled times for group testsolves. We aimed for two clean testsolves on each puzzle, which we mostly met (except for some 1.5s). Mark’s diligent scheduling meant that testsolving was never a huge blocker, though we inevitably fell a bit behind when a bunch of puzzles were all written in the July rush. This year we had a button in Puzzlord to automatically create a Google Sheet for testsolving sessions, which proved extremely convenient; there are also other features like Discord integration, found in Puzzlord forks such as ",l.jsx(t.a,{href:"https://github.com/Palindrome-Puzzles/puzzup",children:"PuzzUp"}),", that might be useful for us to adopt in the future."]}),`
`,l.jsx(t.p,{children:"Obviously, due to the structural decisions, it was particularly difficult to testsolve the hunt as a whole. (This was also true in 2022. And 2019. Okay, one year we’ll learn our lesson.) Generally, we hold three Big TestSolves: SBTS (basically just a coordinated weekend for people to get together to test individual puzzles), MBTS (an internal runthrough of however much of the hunt is available), and BBTS (a final runthrough with external testers who haven’t seen any of the hunt before). This year though, due to the slowdown in writing puzzles, we ended up not having enough ready to justify a SBTS."}),`
`,l.jsx(t.p,{children:"As mentioned in the timeline, MBTS happened the weekend of 7/19. We tested Pan’s Laboratory (which had drafts of 10 out of 12 puzzles at the time, and was the only round postprodded) on Saturday, and Aisle of Crosswords (whose puzzles were written but not postprodded, so it was done through a spreadsheet) on Sunday. MBTS taught us that it was very demoralizing not to have any idea how much of a puzzle you had, so we were going to need to show solvers the approachability icons. The hunt was also proving to be on the difficult side, and we updated the rules with a larger team size in response."}),`
`,l.jsx(t.p,{children:"BBTS happened two weeks before the hunt, on the weekend of 8/9. By the end of the weekend, the group was about halfway through the hunt, and we’re extremely grateful that many of them were willing to continue solving and eventually finish on 8/18. (This also gave enough time for the capstone puzzle to be implemented and given to them.) The BBTS testers provided a ton of useful feedback on UI, hunt mechanics, and individual puzzles, and the hunt certainly improved a lot as a result."}),`
`,l.jsx(t.p,{children:"As for factchecking, it was delayed and happened later than we wanted to (as usual), and we were still checking some of the later puzzles after the hunt started. However, it must have been decently successful given that we only had two errata, both relatively minor wording changes. Shoutouts to Kevin for volunteering to be factchecking lead, and to Yannick for singlehandedly factchecking like half the puzzles."}),`
`,l.jsx(t.h2,{children:"Reflections"}),`
`,l.jsx(t.h3,{children:"Pieces"}),`
`,l.jsx(t.p,{children:"Early on in planning, we decided we wouldn’t require authors to significantly use the pieces mechanic in their feeders, and e.g., it was fine to have puzzles where it would be very easy to put together the pieces, after which it would be a “normal puzzlehunt puzzle”. Was this the right decision? While the theme wasn’t being used to its full potential, authors appreciated having the extra flexibility when writing. And given how far behind schedule we were at times, it was crucial that anyone who wanted to write a puzzle could jump in relatively easily, without having to worry if their idea would fit with a bunch of complex constraints."}),`
`,l.jsx(t.p,{children:"While there were many puzzles that weren’t written with the theme in mind, there also ended up being quite a few puzzles in the “flexible rounds” that made significant use of the pieces mechanic, such as Ring Cycle, Four Pieces, Multiverse of Mixups, The Blue Theatre, Seven Puzzles, and Racing Sounds. Many of these puzzles were written later on, once the hunt began to take shape and authors had a clearer idea of how the piece splitting would work. Overall, we’re pretty happy with the balance and variety of ideas."}),`
`,l.jsx(s,{children:l.jsx(t.p,{children:"The approachability ratings were overall a success, but the precise wording between 🟢 and 💙 caused some issues. Judging from the feedback, it seems like a lot of teams have treated only 💙 puzzles as “solvable”; this includes an overall sentiment that “the unlock radius is too narrow” and some confused emails/messages when Abandoned Site only had one 🟢 puzzle available. In retrospect this is probably to be expected as many teams are used to working on puzzles with complete information, and we probably should have communicated the intent better."})}),`
`,l.jsx(t.h3,{children:"Difficulty"}),`
`,l.jsxs(t.p,{children:["Early on, we made the decision that this GPH was going to be more difficult than the previous two (which were ",l.jsx(t.a,{href:"https://2023.galacticpuzzlehunt.com",children:"somewhat"})," ",l.jsx(t.a,{href:"https://2024.galacticpuzzlehunt.com",children:"unusual"})," in their own ways), and we somewhat aimed for a difficulty similar to 2022. While it did end up harder than 2023 and 2024, it’s possibly harder than even 2022. From numbers alone, only 58 teams finished within the original ten-day hunt span, compared to 294 teams in 2024 and 2023, and 79 teams in 2022. (These numbers aren’t directly comparable though, given that teams this year didn’t ",l.jsx(t.em,{children:"have"})," the ten-day deadline the other hunts did.)"]}),`
`,l.jsx(t.p,{children:"After MBTS confirmed what we thought about the hunt difficulty, we spent some time thinking about adjustments, and how to communicate this to teams. In addition to explicitly saying that this hunt will be harder, we decided to make the team size even larger and extend the hunt length. An additional 65 teams finished within the extended timeframe, some of whom we think would’ve otherwise stopped working on the hunt altogether, so we think this was a good decision."}),`
`,l.jsxs(t.p,{children:["Even accounting for the difficulties observed in the hunt-wide testsolves, the announcements made in advance, and the adjustments made in team size and hunt length, the hunt was ",l.jsx(t.em,{children:"still"})," harder than we expected. There were still several unanticipated sources of difficulty."]}),`
`,l.jsx(t.p,{children:"We had few partial answer confirmations in this hunt. It’s true that it can be frustrating to work off of potentially-incorrect intermediate work, but we think there are several drawbacks to having partial confirmations: they can make a puzzle feel less elegant and reward unintended random guessing. They can also make it too easy to short-circuit a puzzle, as it can turn a step that’s self-confirming with enough work, into a step that can be skipped. So we generally reserved partial answer confirmations for sticking points near the ends of puzzles that we thought were particularly unfun."}),`
`,l.jsx(t.p,{children:"Another source of difficulty was matching the pieces in Abandoned Site. Several teams didn’t realize that the list of 70 words was matched to Seven Puzzles. (For hint requests stuck here, we decided to tell the team what they were missing and refund the hint.) And while we knew that it wasn’t obvious that the 10×10 grid went with Taxononogramy, we weren’t expecting some teams to match it to Symbolic Computation."}),`
`,l.jsx(t.p,{children:"Finally, while we made corrections to the difficulty in response to BBTS, we knew we were not getting another full-hunt testsolve to confirm these corrections, so we erred on the side of being conservative. In some cases, we were perhaps too conservative. We made (A)isle of Crosswords easier, but it was still harder than expected. And we loosened constraints for puzzle and round unlocking, but based on survey feedback it looks like we didn’t go far enough, especially in the early rounds."}),`
`,l.jsx(t.h3,{children:"Web"}),`
`,l.jsx(t.p,{children:"Since the start of the writing process this year, we had a soft goal to make a “web-lite” hunt. Looking at our hunt site, it’s hard to believe that we ever had this goal."}),`
`,l.jsx(t.p,{children:"Nonetheless, the tech stack we built over the previous years was able to deliver this year’s hunt without major modifications. The only really new part, the piece-moving interface, was relatively self-contained. Other needs, like being able to postprod both a puzzle and its component pieces, could be handled by small updates to existing components. We specifically did some iteration on the hint interface in an effort to improve the experience for both askers and responders; that’s part of a larger conversation we’re having within the team and we’ll continue working on those systems in the future."}),`
`,l.jsx(t.p,{children:"Spending less time on tech should in theory allow tech people to do more of other things, and to an extent that did happen. Unfortunately, that time still did get eaten up by hunt tasks and the protracted writing schedule, so we weren’t able to make progress on the long-term infrastructure improvements we’d like to make. The remaining substantial tech work fell disproportionately on one person. The past investment we made in tech was able to carry us through the year, but there are certainly improvements to be made in infrastructure, process, and onboarding."}),`
`,l.jsx(t.p,{children:"One incident perhaps deserves mention: the hunt website was unusable for the first 10 minutes after the posted start time of the hunt. We believe this was due to automatic performance restrictions put in place by our hosting provider in order to prevent denial of service attacks. As such, database operations did not quickly adjust to load spikes, like the ones we see in the beginning of the hunt. These restrictions got lifted on their own."}),`
`,l.jsx(t.p,{children:"Because of the particular way our server is set up, the issue manifested not in familiar ways like getting a timeout or 500 when loading the site, but just in not being able to click through the opening cutscene. Apologies to everyone who had to sit and wait – if it’s any consolation, it does appear that all teams were affected equally."}),`
`,l.jsx(t.h3,{children:"Future"}),`
`,l.jsxs(t.p,{children:["Will there be a Galactic Puzzle Hunt 2026? Perhaps. Join our ",l.jsx(t.a,{href:"https://groups.google.com/g/galacticpuzzlehunt",children:"mailing list"})," to be the first to know."]}),`
`,l.jsx(t.p,{children:"Check out some of these other puzzle hunts coming up:"}),`
